Onotria is back from the dead. But as with most things that come back from the dead, there’s a catch.&nbsp;
Onotria was a very good Italian restaurant at the corner of Bear and Bristol in Costa Mesa, but chef/owner Massimo Navarretta lost his lease a couple of years ago. The building was demolished, and a parking lot sprang up in its place.&nbsp;
Navarretta didn’t disappear, though. He’s apparently been operating a catering business out of a commercial kitchen on Red Hill Avenue, not far from the former restaurant, in a unit that also includes an event space and private tasting room.

